import {Container} from "react-bootstrap";

import 'bootstrap/dist/css/bootstrap.min.css';

import {HeaderImg} from './assets/Group_1.png';

function App() {
  return (
    <Container>
      <head>
        <img src={HeaderImg} alt="Harry Potter" />>
      </head>
      Hola
    </Container>
  );
}

export default App;
